import { useEffect, useState } from 'react';
import mcDuck from '../../data/mc-duck.json';

export function ProductsList({ shop }) {
  const [products, setProducts] = useState([
    {
      id: 'GGOEYXXX0938',
      name: 'YouTube Icon Pullover Black',
      description:
        'This YouTube pullover hoodie will keep you warm while looking stylish with the tone on tone logo.',
      features:
        '<p>8oz. 52% Cotton. 48% Polyester. Fleece</p>\n<p>Kangaroo pocket</p>\n<p>Matching drawcords</p>\n<p>',
      price: '59.99',
      keywords: 'YouTube Icon Pullover Black, pullover, hoodie',
      url: 'YouTube+Icon+Pullover+Black',
      category: 'apparel',
      subcategory: 'apparel',
    },
  ]);

  useEffect(() => {
    switch (shop) {
      case 'mc-duck':
        setProducts(mcDuck);
        break;
      case 'cfk':
        setProducts(mcDuck);
        break;
      case 'minodos-pizza':
        setProducts(mcDuck);
        break;
      case 'bta':
        setProducts(mcDuck);
        break;
      case 'shenro':
        setProducts(mcDuck);
        break;
      default:
        console.log('wrong path');
        setProducts([]);
    }
  }, [shop]);

  return (
    <div>
      <h2>{shop}</h2>
      <ul>
        {products.map(product => (
          <li key={product.id}>
            <p>{product.name}</p>
            <p>{product.price}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}
